import "./expense.css";

function Expense(){
    return(
        <div className="card">
            <div className="card-body">
                <h3 className="expense-title">Food</h3>
                <div className="expense-price">Rs./ - 100</div>
                
            </div>
            <div className="card-footer">
            <div className="expense-date">March 02 2021</div>
            </div>
        </div>
    );
}
export default Expense;
